import React from 'react'
import { Card } from '../../Card/Card'
import { Loader } from '../../UI/loader';
import { Paginator } from '../../UI/paginator';

export const HomePage = ({data, pressHandler, page, pages, next, prev}) => {
  return (
    <> 
    {data ? <div className='wrapper'>
          {data.map(el => (
              <Card data={el} key={el.id} />
          ))}
          <Paginator pages={pages} pressHandler={pressHandler} page={page} next={next} prev={prev}/>
      </div> : <Loader/>}
    </>
  )
}
